import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import { Container, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';


function Cards() {
  return (
    <>
        <nav class="Navbar">
          <div class="cards_container">
          <h2><b>Our Services</b></h2>
          <h5>Choose from our wide range of household services</h5>
          <body>
          <button class="tablink" onclick="openPage('All', this, 'green')" id="defaultOpen"><b>All</b><br/><h6>Services</h6></button> 
          <button class="tablink" onclick="openPage('Contact', this, 'blue')"><b>Clean</b><br/><h6>My Home</h6></button>
          <button class="tablink" onclick="openPage('Guard', this, 'orange')"><b>Guard</b><br/><h6>My Home</h6></button>

          <div id="All" class="tabcontent">
          <button><input type="image" src="https://www.helpr.in/images/category/cleaning.png" width="100" height="80" alt="Home"/>
          <br/>Home<br/><h6>Spa</h6>
          </button>
          {/* <h3>News</h3> */}
          {/* <button type="button" class="btn2 btn-primary btn-lg">Cleaning<br/><h6>Services</h6></button>
          <button type="button" class="btn2 btn-primary btn-lg">Pest Control<br/><h6>Services</h6></button>
          <button type="button" class="btn2 btn-primary btn-lg">Courior<br/><h6>Services</h6></button>
          <button type="button" class="btn2 btn-primary btn-lg">Relocation<br/><h6>Services</h6></button> */}
          </div>
          <hr></hr>
          <h2><b>Annual Maintanence</b></h2>
          <button><input type="image" src="https://www.helpr.in/images/category/cleaning.png" width="100" height="80" alt="Home"/>
          <br/>Home<br/><h6>Spa</h6>
          </button>
          <button type="button" class="btn2 btn-primary btn-lg">Home<br/><h6>Spa</h6></button>
          <button type="button" class="btn2 btn-primary btn-lg"> Home<br/><h6>Guard</h6></button>
          <button><input type="image" src="https://www.helpr.in/images/category/cleaning.png" width="100" height="80" alt="Home"/>
          <br/>Home
          </button>
          </body>
          </div>
        </nav>

    </>
  );
}

export default Cards;
